import React, { useState } from 'react'
import { IoIosStar, IoIosStarOutline } from 'react-icons/io'

const Rating = (props) => {
    const [rating, setRating] = useState(props.rating);
    return (
        <div>
            <h1>Rating: {rating}</h1>
            {
                rating >= 1 ? (
                    <IoIosStar onClick={() => setRating(1)} />
                ) : (
                    <IoIosStarOutline />
                )
            }
            {
                rating >= 2 ? (
                    <IoIosStar />
                ) : (
                    <IoIosStarOutline />
                )
            }
            {
                rating >= 3 ? (
                    <IoIosStar />
                ) : (
                    <IoIosStarOutline />
                )
            }
            {
                rating >= 4 ? (
                    <IoIosStar />
                ) : (
                    <IoIosStarOutline />
                )
            }
            {
                rating >= 5 ? (
                    <IoIosStar />
                ) : (
                    <IoIosStarOutline />
                )
            }
        </div>
    );
}

export default Rating;
